        title: "",
        content:"",
    });

return (
    <>
    <div className="main">
    <form>
    <input 
    type='text' 
    value={note.title} 
    onChange={InputEvent} 
    placeholder="Title" 
    autoComplete="off"        
    /><br/>

    <textarea 
    rows="" 
    coloumn="" 
    value={note.content} 
    onChange={InputEvent} 
    placeholder="Write a note">
    </textarea><br/>
    <Button variant="contained" color="primary"><AddIcon/></Button><br/>
    </form>
    </div>
    </>

);

};

